import React from 'react';
import ReactDOM from 'react-dom';

function MyInfo()
{
  return (
    <div>
  <h1>Hello I am Chikki</h1>
  <p>I am learning Reactjs</p>
  <p>There are a few places i wanna visit</p>
  <ul>
    <li>Amsterdam</li>
    <li>New York</li>
  </ul></div>
  )
}
ReactDom.render()
